package com.matao.bean;import java.io.Serializable;import java.util.List;/** * @author: ZhouYang * @time:2015-5-20 上午10:53:31 * @Description:TODO */public class City implements Serializable {	private String Province;	private int ProvinceId;	private List<City> CityList;	private String CityName;	private int CityId;	private List<City> AreaList;	private String AreaName;	private int AreaId;	public String getProvince() {		return Province;	}	public void setProvince(String province) {		Province = province;	}	public int getProvinceId() {		return ProvinceId;	}	public void setProvinceId(int provinceId) {		ProvinceId = provinceId;	}	public List<City> getCityList() {		return CityList;	}	public void setCityList(List<City> cityList) {		CityList = cityList;	}	public String getCityName() {		return CityName;	}	public void setCityName(String cityName) {		CityName = cityName;	}	public int getCityId() {		return CityId;	}	public void setCityId(int cityId) {		CityId = cityId;	}	public List<City> getAreaList() {		return AreaList;	}	public void setAreaList(List<City> areaList) {		AreaList = areaList;	}	public String getAreaName() {		return AreaName;	}	public void setAreaName(String areaName) {		AreaName = areaName;	}	public int getAreaId() {		return AreaId;	}	public void setAreaId(int areaId) {		AreaId = areaId;	}	@Override	public String toString() {		return "City [Province=" + Province + ", ProvinceId=" + ProvinceId				+ ", CityList=" + CityList + ", CityName=" + CityName				+ ", CityId=" + CityId + ", AreaList=" + AreaList				+ ", AreaName=" + AreaName + ", AreaId=" + AreaId + "]";	}}